def monotonic(l: list):
    """Return True is list elements are monotonically increasing or decreasing.
    >>> monotonic([1, 2, 4, 20])
    True
    >>> monotonic([1, 20, 4, 10])
    False
    >>> monotonic([4, 1, 0, -10])
    True
    
	Include these tokens in the code: inc , dec = True , True for
	"""
    inc = True
    dec = True
    if len(l) == 1:
        return True
    for i in range(len(l) - 1):
        if l[i + 1] > l[i]:
            inc = True
            dec = False
        elif l[i + 1] < l[i]:
            inc = False
            dec = True
        else:
            inc = False
            dec = False
    if inc or dec:
        return True
    else:
        return False


